package com.xuyuan.commons.poi.annotation.bean;import java.util.Date;import com.xuyuan.commons.poi.annotation.util.ExcelAnnotation;public class Testpojo {	/**	 * @uml.property  name="username"	 */	@ExcelAnnotation(exportName = "用户名")	String username;	/**	 * @uml.property  name="loginname"	 */	@ExcelAnnotation(exportName = "登录名")	String loginname;	/**	 * @uml.property  name="age"	 */	@ExcelAnnotation(exportName = "年龄")	Integer age;	/**	 * @uml.property  name="money"	 */	@ExcelAnnotation(exportName = "收入")	Long   money;	/**	 * @uml.property  name="createtime"	 */	@ExcelAnnotation(exportName = "时间")	Date createtime;	/**	 * @return	 * @uml.property  name="username"	 */	public String getUsername() {		return username;	}	/**	 * @param username	 * @uml.property  name="username"	 */	public void setUsername(String username) {		this.username = username;	}	/**	 * @return	 * @uml.property  name="loginname"	 */	public String getLoginname() {		return loginname;	}	/**	 * @param loginname	 * @uml.property  name="loginname"	 */	public void setLoginname(String loginname) {		this.loginname = loginname;	}	/**	 * @return	 * @uml.property  name="age"	 */	public Integer getAge() {		return age;	}	/**	 * @param age	 * @uml.property  name="age"	 */	public void setAge(Integer age) {		this.age = age;	}	/**	 * @return	 * @uml.property  name="money"	 */	public Long getMoney() {		return money;	}	/**	 * @param money	 * @uml.property  name="money"	 */	public void setMoney(Long money) {		this.money = money;	}	/**	 * @return	 * @uml.property  name="createtime"	 */	public Date getCreatetime() {		return createtime;	}	/**	 * @param createtime	 * @uml.property  name="createtime"	 */	public void setCreatetime(Date createtime) {		this.createtime = createtime;	}}